import React from "react";

interface Header1Props {
  title: string
}

export const Header1 = (props: Header1Props) => {
  const { title } = props;

  return (
    <header className="flex flex-1 w-full text-3xl font-bold ">
      <p
        className="text-center"
      ></p>{title}
    </header>
  )
}
